import { Component } from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

class DeleteDataset extends Component {
    constructor(props) {
        super(props)
        this.state = {
            httpMethod: 'DELETE',
        };

        this.handelClose = this.handelClose.bind(this)
        this.handelSubmit = this.handelSubmit.bind(this)
    }

    handelSubmit(e) {
        e.preventDefault();
        console.log(this.state.datasetConfigUserInput)
        this.props.handleSendRequest(JSON.stringify(this.props.datasetConfigJSON), this.state.httpMethod)
    }


    handelClose(e) {
        e.preventDefault();
        console.log(this.state.datasetConfigUserInput)
    }

    render() {
        return (



            <div>
                <form>
                    <h2>Do you want to Delete {this.props.datasetConfigJSON.name}?</h2>
                    <button onClick={this.handelSubmit}>Yes</button>
                    <button onClick={this.handelClose}>No</button>
                </form>







            </div>



        )
    }
}


export default DeleteDataset
